let IconNode;
let InjectSVG = () => {
    IconNode = document.querySelectorAll("[data-icon]");
    IconNode.forEach(function (item, key) {
        //let tempIconNode = item;
        let tempIconNodeData = item.dataset.icon;
        let ratio = item.dataset.ratio;

        if (iconObject[tempIconNodeData] != undefined) {
            item.insertAdjacentHTML('beforeend', iconObject[tempIconNodeData])
        } else {
            let errorString = `%c Yuger.js Error: ${tempIconNodeData} Icon not found`;
            console.log(errorString, "color: #ff4646; font-weight: bold");
        }

        if(ratio !== undefined){
            item.querySelector("svg").setAttribute("width", ratio*20);
            item.querySelector("svg").setAttribute("height",ratio*20);
        }
    })
};
if (document.readyState !== "loading") {
    InjectSVG()
} else {
    document.addEventListener("DOMContentLoaded", function () {
        InjectSVG()
    })
}

